import React from 'react';
import { Button, Text } from 'react-native';

const Home = () => {
    const [movies, setMovies] = useState(true);

    return (
        <>
            <Text>Movie Library</Text>
            {movies &&
                <>
                    <Text>Recently Added</Text>
                    <Movie />
                </>
            }
            <Text>View By</Text>
            <Button>Title</Button>
            <Button>Genre</Button>
            <Button>Actor</Button>
            <Button>Format</Button>
        </>
    );
}

export default Home;
